import React from 'react';
import { createUseStyles} from 'react-jss';

const useStyles = createUseStyles({
  createButton: {
    alignItems: "center",
    background: "black",
    color: "white",
    border: "none", 
    cursor: "pointer",
    paddingLeft: 20,
    paddingRight: 20,
    display: "flex",
    fontWeight: "bold",
  },

  buttonContainer: {
    position: "relative",
    alignItems: "center"
  }
});


function CreateButton({ label, onClick })
{
  const classes = useStyles();
  
    return (
        <button className={classes.createButton} onClick={onClick}>
          {label}
        </button>
    );
}

export default CreateButton;
